import React from "react";

import "./Nav.css";
import Button from '@mui/material/Button';
import LoginIcon from '@mui/icons-material/Login';

function Nav() {
  return (
    <header>
      <div className="Navigator">
        <nav>
			<h1>&emsp;&emsp;CANTEEN PORTAL</h1>
            <Button variant="contained" style={{ flex: 1 }}><LoginIcon>Login</LoginIcon></Button>
        </nav>
      </div>
    </header>
  );
}

export default Nav;
